import zIndex from '@material-ui/core/styles/zIndex'
import {makeStyles} from '@material-ui/styles'

const useStyles = makeStyles((theme)=>({
   container:{
      position:'relative',
      display:'flex',
      alignItems:'center',
      justifyContent:'center',
      textAlign:'center',
      height:'100vh'
   },
   video:{
      position:'absolute',
      top:'0',
      left:'0',
      right:'0',
      bottom:'0'
   }
}))

export default useStyles
